class FeelsLike {  double? day;  double? night;  double? eve;  double? morn;    FeelsLike({      this.day,       this.night,       this.eve,       this.morn,});  FeelsLike.fromJson(dynamic json) {    day = json['day'];    night = json['night'];    eve = json['eve'];    morn = json['morn'];  }}